import React from 'react';

const Article = (props) => ( 
    <div>
        <h1 class="headline"> { props.title } </h1> 
        <time> { props.date } </time> 
        <br/>
        <span class="author">Kate Farley</span>
        <hr/>
        <p> { props.children } </p> 
    </div>
);

export default Article;
